    public class MatrixPixel : IComparable
    {
        public int iPosition;
        public int jPosition;
        public int luminosity;

        // 0 => equality
        // -1 this is > then compared
        // 1 this is < than compared
        public int CompareTo(object obj)
        {

            if (obj.GetType() != GetType())
            {
                if (obj.GetHashCode() < GetHashCode())
                {
                    return -1;
                }

                if (obj.GetHashCode() > GetHashCode())
                {
                    return 1;
                }

                return 0;
            }

            MatrixPixel pix = (MatrixPixel)obj;

            if (pix.iPosition < iPosition)
            {
                return 1;
            }

            if (pix.iPosition > iPosition)
            {
                return -1;
            }

            if (pix.jPosition < jPosition)
            {
                return 1;
            }

            if (pix.jPosition > jPosition)
            {
                return -1;
            }

            return 0;
        }
    }

    public class ColorArea
    {
        public int startColorIndex = -1;
        public int endColorIndex = -1;
        public int line = -1;

        public bool IsEmpty()
        {
            return line == -1 || startColorIndex == -1 || endColorIndex == -1;
        }
        public ColorArea nextColor;
        internal int colorId;
    }

    public class MatrixImageProcessing
    {
        List<List<int>> moonMatrix = new List<List<int>>();
        Dictionary<int, int> luminosity = new Dictionary<int, int>();
        Dictionary<int, List<MatrixPixel>> nodesByLuminosity = new Dictionary<int, List<MatrixPixel>>();

        int matrixHeight;
        int matrixWidth;
        int minStartI;
        int minStartJ;
        int maxEndI;
        int maxEndJ;

        public MatrixImageProcessing(string input)
        {
            string[] matrixData = input.Split(' ');
            matrixHeight = Int32.Parse(matrixData[0]);
            matrixWidth = Int32.Parse(matrixData[1]);
            moonMatrix = new List<List<int>>();

            int i = 0;
            int j = 0;
            for (int k = 2; k < matrixWidth * matrixHeight + 2; k++)
            {
                if (i >= moonMatrix.Count)
                {
                    moonMatrix.Add(new List<int>());
                }

                int idOrLuminosity = Int32.Parse(matrixData[k]);
                moonMatrix[i].Add(Int32.Parse(matrixData[k]));
                j++;

                if (idOrLuminosity != 0)
                {
                    if (!nodesByLuminosity.ContainsKey(idOrLuminosity))
                    {
                        nodesByLuminosity.Add(idOrLuminosity, new List<MatrixPixel>());
                    }
                    nodesByLuminosity[idOrLuminosity].Add(new MatrixPixel
                    {
                        iPosition = i,
                        jPosition = moonMatrix[i].Count - 1,
                        luminosity = idOrLuminosity
                    });
                }

                if (j == matrixWidth)
                {
                    j = 0;
                    i++;
                }
            }

            int numberOfLuminosity = Int32.Parse(matrixData[matrixHeight * matrixWidth + 2]);
            int end = matrixHeight * matrixWidth + 3 + numberOfLuminosity * 2;
            for (int k = matrixHeight * matrixWidth + 3; k < end; k += 2)
            {
                luminosity.Add(Int32.Parse(matrixData[k]), Int32.Parse(matrixData[k + 1]));
            }

            LogImage();
            FindSmallestSqare();

            //CheckImageWithLights();
            RemapImageFromLights();
            LogImage();
        }

        public void FindSmallestSqare()
        {
            minStartI = FindHorizontaEdge(0, 1);
            minStartJ = FindVerticalEdge(0, 1);
            maxEndI = FindHorizontaEdge(matrixHeight - 1, -1);
            maxEndJ = FindVerticalEdge(matrixWidth - 1, -1);
        }

        public void CheckImageWithLights()
        {
            int maxAcceptedDistance = 2;
            List<ColorArea> colorAreasOnLine = GetColorAreasByLine();
            List<int> markedColors = new List<int>();

            foreach (ColorArea item in colorAreasOnLine)
            {
                ColorArea current = item;
                while (current.nextColor != null)
                {
                    if (current.nextColor.startColorIndex - current.endColorIndex <= maxAcceptedDistance)
                    {
                        if (luminosity.ContainsKey(current.colorId) &&
                            luminosity.ContainsKey(current.nextColor.colorId) &&
                            luminosity.GetValueOrDefault(current.colorId) > luminosity.GetValueOrDefault(current.nextColor.colorId))
                        {
                            markedColors.Add(current.colorId);
                            markedColors.Add(current.nextColor.colorId);
                            // double jump
                            current = current.nextColor.nextColor;
                        }
                    }
                    else
                    {
                        current = current.nextColor;
                    }
                }
            }

            for (int i = minStartI; i < maxEndI; i++)
            {
                for (int j = minStartJ; j < maxEndJ; j++)
                {
                    moonMatrix[i][j] = markedColors.Contains(moonMatrix[i][j])
                         ? 1
                         : 0;
                }
            }

        }

        private int FindHorizontaEdge(int start, int addCount)
        {
            int i = start;
            bool canIncreseI = true;
            while (canIncreseI && i >= 0 && i < matrixHeight)
            {
                int nodeValue = moonMatrix[i].FirstOrDefault(it => it != 0);
                if (nodeValue == 0)
                {
                    i = i + addCount;
                }
                else
                {
                    canIncreseI = false;
                    if (i > 0)
                    {
                        if (addCount > 0)
                        {
                            i = i - addCount;
                        }
                        else
                        {
                            i = i + (-1 * addCount);
                        }
                    }
                }
            }
            return i;
        }

        private int FindVerticalEdge(int start, int addCount)
        {
            int j = start;
            bool canIncreseJ = true;
            while (canIncreseJ && j >= 0 && j < matrixWidth)
            {
                for (int k = 0; k < matrixHeight; k++)
                {
                    if (moonMatrix[k][j] != 0)
                    {
                        canIncreseJ = false;
                    }
                }

                if (canIncreseJ)
                {
                    j = j + addCount;
                }
                else
                {
                    if (j > 0)
                    {
                        if (addCount > 0)
                        {
                            j = j - addCount;
                        }
                        else
                        {
                            j = j + (-1 * addCount);
                        }
                    }
                }
            }

            return j;
        }

        private List<ColorArea> GetColorAreasByLine()
        {
            List<ColorArea> colorAreasOnLine = new List<ColorArea>();

            for (int i = minStartI; i < maxEndI; i++)
            {
                ColorArea colorAreaOnLine = new ColorArea();
                ColorArea current = colorAreaOnLine;
                ColorArea previous = null;

                for (int j = minStartJ; j < maxEndJ; j++)
                {
                    int currentColorId = moonMatrix[i][j];

                    if (current.startColorIndex == -1 &&
                        moonMatrix[i][j] == 0 &&
                        ((j + 1 < matrixWidth &&
                        moonMatrix[i][j + 1] != 0) || (j + 1 >= matrixWidth)))
                    {
                        current.line = i;
                        current.startColorIndex = j;
                        current.colorId = moonMatrix[i][j + 1];
                    }
                    else if (current.startColorIndex != -1 &&
                       moonMatrix[i][j] != 0 &&
                      ((j + 1 < matrixWidth &&
                      moonMatrix[i][j + 1] == 0) || (j + 1 >= matrixWidth)))
                    {
                        current.endColorIndex = j;
                        current.line = i;
                        current.nextColor = new ColorArea();
                        previous = current;
                        current = current.nextColor;
                    }
                }

                if (previous != null && previous.nextColor.IsEmpty())
                {
                    previous.nextColor = null;
                }

                if (!colorAreaOnLine.IsEmpty())
                {
                    colorAreasOnLine.Add(colorAreaOnLine);
                }
            }
            return colorAreasOnLine;
        }

        private void RemapImageFromLights()
        {
            foreach (int idColor in luminosity.Keys)
            {
                List<MatrixPixel> possibleNodex = nodesByLuminosity[luminosity[idColor]];
                int i = 0;
                bool areConnected = true;

                while (i < possibleNodex.Count && areConnected)
                {
                    MatrixPixel currentNode = possibleNodex[i];
                    if (i + 1 < possibleNodex.Count)
                    {
                        MatrixPixel nextNode = possibleNodex[i + 1];
                        if ((currentNode.jPosition + 1 == nextNode.jPosition && currentNode.iPosition == nextNode.iPosition) ||
                            (currentNode.iPosition + 1 == nextNode.iPosition && currentNode.jPosition == nextNode.jPosition) ||
                            (currentNode.jPosition - 1 == nextNode.jPosition && currentNode.iPosition == nextNode.iPosition) ||
                            (currentNode.iPosition - 1 == nextNode.iPosition && currentNode.jPosition == nextNode.jPosition)
                            )
                        {
                            moonMatrix[currentNode.iPosition][currentNode.jPosition] = idColor;
                        }
                        else if (currentNode.iPosition + 1 == nextNode.iPosition)
                        {
                            moonMatrix[currentNode.iPosition][currentNode.jPosition] = idColor;
                        }
                        else
                        {
                            moonMatrix[currentNode.iPosition][currentNode.jPosition] = idColor;
                            possibleNodex.RemoveRange(0, i + 1);
                            areConnected = false;
                        }

                    }
                    else
                    {
                        // last node for idColor
                        moonMatrix[currentNode.iPosition][currentNode.jPosition] = idColor;
                    }

                    i++;
                }

            }
        }

        private void LogImage()
        {
            Console.WriteLine();
            for (int i = 0; i < matrixHeight; i++)
            {
                Console.WriteLine(string.Join(' ', moonMatrix[i]));
            }
        }

